const Navigator = () => {
    return (
        <nav>
            <ul>
                <li>
                    <a>Home</a>
                </li>
            </ul>
            <ul>
                <li>
                    <a>sign-in</a>
                </li>
            </ul>
            <style>{
                `ul {
                  list-style-type: none;
                  margin: 0;
                  padding: 0;
                }

                li {
                  display: inline;
                  float: left;
                }

                a {
                  padding : 5px;
                }
                `

                }
            </style>
        </nav>
    )
}

export default Navigator;
